import React from 'react';
import styles from './../styles/mainPage.scss';
import {

  Switch,
  Route,
  Link,
} from "react-router-dom";
import Drinkerator from "./drinkerator";
import Gallery from "./gallery";
import Portfolio from "./portfolio";
import WorkRelated from "./workRelated";

const MainPage = () => (

  <div className = {styles}>
    <div className = "project-container">
    <Link to = "/drinkerator">
    <div className = "project project-1"> drinkerator</div>
    </Link>
    <Link to = "/gallery"> <div className = "project project-2"> gallery</div></Link>

    <Link to = "/workrelated"> <div className = "project project-3">workrelated</div></Link>

    <Link to = "/portfolio"><div className = "project project-4"> portfolio</div></Link>

    </div>

  <Switch>
    <Route path = "/drinkerator" component = {Drinkerator} exact/>
    <Route path = "/gallery" component = {Gallery} exact/>
    <Route path = "/workrelated" component = {WorkRelated} exact/>
    <Route path = "/portfolio" component = {Portfolio} exact/>

  </Switch>

  </div>

);

export default MainPage;
